import React from "react";
import "./DescriptionTwo.css";

export default function DescriptionTwo() {
  return (
    <p>
      {" "}
      The platform
      <br /> will collect and
      <br /> map a collaborative
      <br /> image dataset, uploaded
      <br /> by users worldwide for train-
      <br /> ing future, computer vision
      <br /> technologies challen-
      <br /> ging mainstream re-
      <br /> presentations of
      <br /> migrants.
    </p>
  );
}
